  false,\n\t\"url\": null,\n\t\"notes\": \"This digital elevation model (DEM) is a
  part of a series of DEMs produced for the National Oceanic and Atmospheric Administration
  Office for Coastal Management's Sea Level Rise and Coastal Flooding Impacts Viewer
  (www.coast.noaa.gov/slr/viewer). The DEMs created for this project were developed
  using the NOAA National Weather Service's Weather Forecast Office (WFO) boundaries.
  Because the WFO boundaries can cover large areas, the WFO DEM was divided into smaller
  DEMs to ensure more manageable file sizes. The Mobile/Tallahassee (AL/FL) WFO DEM
  was split into three smaller DEMS. They are divided as follows: 1. Mobile/Tallahassee
  (AL/FL) WFO - Mobile County in Alabama and Escambia, Santa Rosa, and Okaloosa (portion)
  Counties in Florida 2. Mobile/Tallahassee (AL/FL) WFO - Okaloosa (portion), Walton,
  Bay, Gulf, Franklin (portion), and Wakulla (portion) Counties 3. Mobile/Tallahassee
  (AL/FL) WFO - Wakulla (portion), Franklin (portion), Jefferson, Taylor, Dixie, and
  Levy Counties. This metadata record describes the DEM for the Mobile/Tallahassee
  (AL/FL) WFO - Mobile County in Alabama and Escambia, Santa Rosa, and Okaloosa (portion)
  Counties in Florida. The DEM includes the best available lidar data known to exist
  at the time of DEM creation for the coastal areas of Mobile County in Alabama and
  Escambia, Santa Rosa, and Okaloosa (portion) counties in Florida, that met project
  specification. This DEM is derived from the USGS National Elevation Dataset (NED),
  US Army Corps of Engineers (USACE) LiDAR data, as well as LiDAR collected for the
  Northwest Florida Water Management District (NWFWMD) and the Florida Department
  of Emergency Management (FDEM). NED and USACE data were used only in Mobile County,
  AL. NWFWMD or FDEM data were used in all other areas. Hydrographic breaklines used
  in the creation of the DEM were obtained from FDEM and Southwest Florida Water Management
  District (SWFWMD). This DEM is hydro flattened such that water elevations are less
  than or equal to 0 meters. This DEM is referenced vertically to the North American
  Vertical Datum of 1988 (NAVD88) with vertical units of meters and horizontally to
  the North American Datum of 1983 (NAD83). The resolution of the DEM is approximately
  5 meters. This DEM does not include licensed data (Baldwin County, Alabama) that
  is unavailable for distribution to the general public. As such, the extent of this
  DEM is different than that of the DEM used by the NOAA Office for Coastal Management
  in creating the inundation data seen in the Sea Level Rise and Coastal Impacts Viewer
  (www.coast.noaa.gov/slr/viewer).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
